import React from 'react';
import '../requists/requist.scss';
import {Ptw} from '../context/PtwContext';

import { DataGrid } from '@mui/x-data-grid';
import {Box, useTheme} from '@mui/material';
import { ColorModeContext, tokens } from '../theme/theme';

export default function Requist () {
    let theUsedContext = React.useContext(Ptw);

    const theme = useTheme();
    const colors = tokens(theme.palette.mode);
    let themeToggle = React.useContext(ColorModeContext);

    let statusThemes = {
        valid: "green",
        notValid: "red",
    }


    const columns = [
        {field: "id", headerName: "number"},
        {field: "type", headerName: "type", width: 150, editable: true},
        {field: "authorized", headerName: "authorized", width: 150, editable: true},
        {field: "location", headerName: "location", width: 150, editable: true},
        {field: "department", headerName: "department", width: 150, editable: true},
        {field: "valid", headerName: "valid", width: 150, editable: true},
        {field: "description", headerName: "description", width: 150, editable: true}
    ];

    const rows = theUsedContext.ptwState.ptw;

    return (

        <Box  
            sx = {{
                backgroundColor: colors.primary[500],
                height: 400,
                width: "100%"
            }}>

            <DataGrid rows = {rows} columns = {columns} pageSize = {5}/>

        </Box>

    )
}
